import React, { useState } from "react";
import Context from "./Context";
import { theme } from "../utils";

export default function ContextWrapper(props) {
  const [rooms, setRooms] = useState([]);

  return (
    <Context.Provider value={{ theme, rooms, setRooms }}>
      {props.children}
    </Context.Provider>
  );
}
